import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>Bonjour, je suis Anthony Sargento</p>
      </header>
      <img 
        className='waves'
        src="/wave.svg"
        />
      <body>
        <p>Connaissez-vous Nord VPN ?</p>
      </body>
      <img 
        className='waves'
        src="/wave(1).svg"
        />
    </div>
  );
}

export default App;
